import './App.css';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Header from './components/header/Header';
import Login from './components/login/Login';
import SignIn from './components/signIn/SignIn';
import SignInCheck from './components/signInCheck/SignInCheck';
import ChangePw from './components/changePw/ChangePw';
import ChangePwCheck from './components/changePwCheck/ChangePwCheck';
import NotFound from './components/notFound/NotFound'


function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Header/>}/>
        <Route path="/login" element={<Login/>}/>
        <Route path="/signIn" element={<SignIn/>}/>
        <Route path='/signInCheck'element={<SignInCheck/>}/>
        <Route path='/changePw' element={<ChangePw/>}/>
        <Route path='/changePwCheck' element={<ChangePwCheck/>}/>
        <Route path='/notFound' element={<NotFound/>}/>
        <Route path='/main' element={<Main/>}/>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
